import './App.css';
import Home from "./pages/Home";
import Event from "./pages/Event";
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
      <Navbar/>
      <Routes>

        <Route path="/" element={<Home />} />
        <Route path="/Event" element={<Event />} />

      </Routes>
    </Router>
  );
}

export default App;
